import React from 'react';

export default function GoogleMap() {
  return (
    <iframe 
      title="Google Maps" 
      src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d202770.18537139846!2d6.128855380510094!3d43.265475044251524!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x12c94ecf18280309%3A0x30819a5fd8f2ab0!2sVar!5e0!3m2!1sfr!2sfr!4v1704230334067!5m2!1sfr!2sfr" 
      width="300" 
      height="350" 
      style={{ border: 0 }} 
      allowFullScreen="" 
      loading="lazy" 
      referrerPolicy="no-referrer-when-downgrade">
    </iframe>
  );
}
